import React from "react";
import LogoFooter from "../assets/FooterDesktop.png";

const Footer = () => {
  return (
    <div className="footer">
      <div>
        <img src={LogoFooter} alt="logo bas de page" />
      </div>
    </div>
  );
};

export default Footer;
